class Solution {
    func sortVowels(_ s: String) -> String {
        let vowels = "aeiouAEIOU"
        var vowelsOnly = s.filter { vowels.contains($0) }.sorted()
        var result = ""
        for char in s {
            if vowels.contains(char) {
                result.append(vowelsOnly.removeFirst())
            } else {
                result.append(char)
            }
        }
        return result
    }
}
